import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class PatientService {
  apiUrl = "https://localhost:7126/api/Patients/getall";

  constructor(private httpClient:HttpClient) { }

  getPatients():Observable<PatientResponseModel>{
    return this.httpClient.get<PatientResponseModel>(this.apiUrl);
  }

}
